import React from "react";
import { Row, Col } from "react-bootstrap";

const LandingPage = () => (
  <Row className="content homepage">
    <p>
      <strong>
        NO PURCHASE NECESSARY TO ENTER OR WIN. A PURCHASE WILL NOT INCREASE YOUR
        CHANCE OF WINNING.
      </strong>{" "}
      Sweepstakes begins at 7:00:00am ET on <strong>10/24/19</strong> and ends
      at 11:59:59pm ET on <strong>12/28/19.</strong> Each day the entry period
      begins at 12:00am ET and ends at 11:59:59pm ET on the same day. Promotion
      is open to legal residents of 50 United States or D.C who are 21 years of
      age or older. Void where prohibited by law.{" "}
      <a href="/rules" target="_blank" rel="noopener noreferrer">
        Click here
      </a>{" "}
      for complete Official Rules including prize details and separate daily
      entry periods. Sponsor: Crown Media United States, LLC. Ballard Designs is
      not the administrator for this promotion.
    </p>
  </Row>
);

export default LandingPage;
